import React from 'react';
import { Line } from 'react-chartjs-2';
import { useLocation } from 'react-router-dom';

const GraphsPage = () => {
  const location = useLocation();
  const tableData = location.state?.tableData || [];

  // Assuming your tableData is an array of objects, where each object is a row in the table
  // and each property of the object corresponds to a cell in the row
  return (
    <div>
      <table>
        <thead>
          <tr>
            {/* Replace these headers with the actual headers of your data */}
            <th>Header 1</th>
            <th>Header 2</th>
            <th>Header 3</th>
            {/* etc... */}
          </tr>
        </thead>
        <tbody>
          {tableData.map((row, index) => (
            <tr key={index}>
              {/* Replace `cellKey1`, `cellKey2`, etc., with the actual keys from your data objects */}
              <td>{row[index]}</td>
              <td>{row[index+1]}</td>
              <td>{row[index+2]}</td>
              {/* etc... */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default GraphsPage;
